    _processReferral(actionType) {
        this.setState({spinner: !this.state.spinner, actionType: actionType});
        AsyncStorage.getItem("user").then(result => this.setState({user: JSON.parse(result)}));

        HealthcareAPI
            .post(
                '/referral/update',
                {
                    id: this.state.referral.noRujukan,
                    status: actionType,
                    reasons: this.state.reasons,
                }
            )
            .then(() => {
                let url = "";
                let storage = "";

                if(this.state.referralType <= 1) {
                    if(this.state.referralDirection <= 0) {
                        url = '/referral/poli/in';
                        storage = 'referralPoliIn';
                    } else {
                        url = '/referral/poli/out';
                        storage = 'referralPoliOut';
                    }
                } else {
                    if(this.state.referralDirection <= 0) {
                        url = '/referral/emergency/in';
                        storage = 'referralEmergencyIn';
                    } else {
                        url = '/referral/emergency/out';
                        storage = 'referralEmergencyOut';
                    }
                }

                HealthcareAPI
                    .get(
                        url,
                        {
                            params: {
                                id: this.state.user.idFaskes
                            }
                        }
                    )
                    .then(response => {
                        AsyncStorage.setItem(storage, JSON.stringify(response.data));
                        this.setState({spinner: !this.state.spinner});
                        let popAction = StackActions.pop({
                            n: 1,
                        });

                        this.props.navigation.dispatch(popAction);
                    })
            })
            .catch(error => console.log(error.response));
    };

    _getAge(dateString) {
        let today = new Date();
        let birthDate = new Date(dateString);
        let age = today.getFullYear() - birthDate.getFullYear();
        let m = today.getMonth() - birthDate.getMonth();
        if (m < 0 || (m === 0 && today.getDate() < birthDate.getDate())) {
            age--;
        }
        return age;
    }

