    _downloadReferralDocument(name, type) {
        
        let title = "-rujukan-" + this.state.referral.noRujukan;
        if(type <= 1) {
            title = "pemeriksaan-darah" + title;
        } else {
            title = "pemeriksaan-lain" + title;
        }

        const { config, fs } = RNFetchBlob;
        let DownloadDir = fs.dirs.DownloadDir // this is the pictures directory. You can check the available directories in the wiki.
        let options = {
            fileCache: true,
            addAndroidDownloads : {
                useDownloadManager : true, // setting it to true will use the device's native download manager and will be shown in the notification bar.
                title: title,
                notification : true,
                path:  DownloadDir,
                description : 'Downloading image.'
            }
        }
        config(options).fetch('GET', this.url + "/files/" + name).then(response => {});

    }

